style.css:
@-moz-document url-prefix("https://docs.google.com/spreadsheets/d/13xtkPF3ghU1VFmCD3xRmpE7cT7Vsi0fZisOjzGleIEU/edit#gid=0") {
/* Set text color to #FC8FD2 for specific elements */
  .docs-sheet-tab-name, 
  .docs-title-input, 
  .docs-icon-img-container,
  .app-switcher-button-icon, 
  .logo {
    color: #FC8FD2;
  }

  /* Set text color to #FFF for most elements except specific classes */
  body:not(.docs):not(.app):not(.logo) {
    color: #FFF;
  }

  /* Set background color for specific elements */
  .docs-main-toolbars,
  .docs-sheet-container-bar, 
  .docs-sheet-button-bar-container,
  .grid-bottom-bar, 
  .docs-sheet-status-container-avs,
  .native-scrollbar, 
  .docs-titlebar-buttons, 
  .menu-button,
  .goog-inline-block, 
  .docs-save-indicator-icon, 
  .docs-titlebar-badge,
  .a {
    background-color: #ffe7f6;
  }

  /* Set background color for the rest of the elements to #FFFFFF */
  body {
    background-color: #FFFFFF;
  }

  /* Targeting element with ID myDiv */
  #myDiv {
    background-color: #ffe7f6; /* Adjust as needed */
  }
}
